<!DOCTYPE html>

<html lang="en"><head>
<meta charset="utf-8"/>
<meta content="width=device-width, initial-scale=1.0" name="viewport"/>
<title>Penny User Network Visualization</title>
<link href="/marketing.css?v={{ filemtime(public_path('marketing.css')) }}" rel="stylesheet"/>
<!-- Google Fonts: Playfair Display (Serif) and Inter (Sans-serif) -->
<link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600&amp;family=Playfair+Display:wght@400;600;700&amp;display=swap" rel="stylesheet"/>
<!-- Custom Styles for Typography and Animations -->
<style data-purpose="typography">
        body {
            font-family: 'Inter', sans-serif;
            background-color: #1F2B26;
            color: white;
            overflow: hidden; /* Prevent scroll bars for the dashboard feel */
        }
        h1, h2, h3, .serif-font {
            font-family: 'Playfair Display', serif;
        }
    </style>
<style data-purpose="network-viz">
        .network-container {
            position: relative;
            width: 100%;
            height: 100%;
            overflow: hidden;
        }
        .node {
            transition: all 0.3s ease;
            cursor: pointer;
        }
        .node:hover {
            transform: scale(1.1);
        }
        .connection-line {
            stroke-dasharray: none;
        }
        /* Specific glow for the active connection */
        .active-connection {
            stroke-dasharray: 0;
            filter: drop-shadow(0 0 3px rgba(100, 200, 255, 0.8));
        }
        /* Popover card styling */
        .popover-card {
            background: white;
            color: #1a202c;
            box-shadow: 0 10px 25px -5px rgba(0, 0, 0, 0.3), 0 8px 10px -6px rgba(0, 0, 0, 0.1);
            animation: fadeIn 0.5s ease-out forwards;
        }
        @keyframes fadeIn {
            from { opacity: 0; transform: translateY(10px); }
            to { opacity: 1; transform: translateY(0); }
        }
    </style>
</head>
<body class="h-screen w-screen flex flex-col md:flex-row bg-penny-dark">
<!-- BEGIN: Sidebar -->
<aside class="w-full md:w-64 flex-shrink-0 border-r border-white/10 bg-penny-dark/50 flex flex-col p-6 h-full z-20">
<!-- Sidebar Search -->
<div class="mb-8 relative" data-purpose="sidebar-search">
<span class="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none text-penny-sidebar-text">
<svg class="h-4 w-4" fill="none" stroke="currentColor" viewbox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
<path d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" stroke-linecap="round" stroke-linejoin="round" stroke-width="2"></path>
  </svg>
</span>
<input class="w-full bg-[#2C3E36] border border-white/10 rounded-lg py-2 pl-10 pr-3 text-sm text-gray-200 placeholder-penny-sidebar-text focus:outline-none focus:border-penny-green focus:ring-1 focus:ring-penny-green transition-colors" data-role="search" placeholder="Search User" type="search"/>
</div>
<!-- Filter by Status Section -->
<div class="mb-8" data-purpose="filter-section">
<h3 class="text-xs uppercase tracking-wider text-penny-sidebar-text font-semibold mb-4">Filter by Status</h3>
<div class="space-y-3">
<label class="flex items-center space-x-3 cursor-pointer group">
<input class="form-radio h-4 w-4 text-penny-green border-white/30 bg-transparent focus:ring-penny-green focus:ring-offset-penny-dark" name="status" value="paying" data-role="status" type="radio"/>
<span class="flex items-center text-sm text-gray-300 group-hover:text-white transition-colors">
<span class="w-2 h-2 rounded-full bg-penny-green mr-2 shadow-[0_0_8px_rgba(168,198,182,0.6)]"></span>
                        Paying
                    </span>
</label>
<label class="flex items-center space-x-3 cursor-pointer group">
<input class="form-radio h-4 w-4 text-penny-beige border-white/30 bg-transparent focus:ring-penny-beige focus:ring-offset-penny-dark" name="status" value="free" data-role="status" type="radio"/>
<span class="flex items-center text-sm text-gray-300 group-hover:text-white transition-colors">
<span class="w-2 h-2 rounded-full bg-penny-beige mr-2"></span>
                        Free
                    </span>
</label>
</div>
</div>
<!-- User Search Input -->
<div class="mb-6" data-purpose="user-search-filter">
<label class="block text-xs uppercase tracking-wider text-penny-sidebar-text font-semibold mb-2">Search User</label>
<input class="w-full bg-[#2C3E36] border border-white/10 rounded px-3 py-2 text-sm text-gray-200 focus:outline-none focus:border-penny-green transition-colors" data-role="search" placeholder="Search User" type="search"/>
</div>
<!-- Date Range Filter -->
<div class="mb-6" data-purpose="date-range-filter">
<label class="block text-xs uppercase tracking-wider text-penny-sidebar-text font-semibold mb-2">Date Range</label>
<div class="relative">
<select class="w-full bg-[#2C3E36] border border-white/10 rounded px-3 py-2 text-sm text-gray-200 focus:outline-none focus:border-penny-green transition-colors appearance-none text-gray-400" data-role="date-range"><option value="all">Date to Range</option><option value="30">Last 30 Days</option><option value="90">Last Quarter</option></select>
<div class="pointer-events-none absolute inset-y-0 right-0 flex items-center px-2 text-gray-400">
<svg class="fill-current h-4 w-4" viewbox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><path d="M9.293 12.95l.707.707L15.657 8l-1.414-1.414L10 10.828 5.757 6.586 4.343 8z"></path></svg>
</div>
</div>
</div>
<!-- Sidebar Footer Info -->
<div class="mt-auto pt-6 border-t border-white/10 text-xs text-penny-sidebar-text">
<p>Admin Dashboard v2.4</p>
<p class="mt-1">Â© 2023 Penny Health</p>
</div>
</aside>
<!-- END: Sidebar -->
<!-- BEGIN: Main Content -->
<main class="flex-1 relative flex flex-col h-full overflow-hidden">
<!-- Header Section -->
<header class="absolute top-0 left-0 w-full z-30 pt-8 pb-4 text-center pointer-events-none">
<!-- Breadcrumbs -->
<nav class="text-xs text-penny-green mb-2 tracking-wide uppercase font-medium opacity-80 pointer-events-auto inline-block px-4 py-1 rounded-full bg-black/20 backdrop-blur-sm">Penny Health <span class="mx-1 text-white/40">/</span> Admin <span class="mx-1 text-white/40">/</span> Network Visualisation</nav>
<!-- Main Title -->
<h1 class="text-3xl md:text-4xl text-white font-serif tracking-wide drop-shadow-md text-4xl">Penny User Network Visualization</h1>
</header>
<!-- BEGIN: Network Visualization Area -->
<div class="w-full h-full relative bg-radial-gradient flex items-center justify-center network-container" id="visualization-canvas">
<!-- Custom Background Gradient -->
<div class="absolute inset-0 z-0" style="background: radial-gradient(circle at center, #2C3E36 0%, #1F2B26 70%);"></div>
<!-- SVG Layer for connections -->
<svg class="absolute inset-0 w-full h-full z-0 pointer-events-none" xmlns="http://www.w3.org/2000/svg">
<defs>
<linearGradient id="active-line-gradient" x1="0%" x2="100%" y1="0%" y2="0%">
<stop offset="0%" style="stop-color:#4a89db;stop-opacity:0.2"></stop>
<stop offset="100%" style="stop-color:#A3EAF8;stop-opacity:1"></stop>
</linearGradient>
</defs>
<g id="user-lines"></g>
</svg>
<!-- Center Node (Penny Logo) -->
<div class="absolute z-10 top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-28 h-28 rounded-full bg-penny-blue flex items-center justify-center shadow-[0_0_50px_rgba(59,109,176,0.4)]">
<div class="w-full h-full rounded-full overflow-hidden bg-white p-0 flex items-center justify-center border-4 border-[#2C3E36]">
<img alt="Penny Logo" class="w-full h-full object-cover" src="data:image/png;base64,"/>
</div>
<div class="absolute top-full mt-3 text-white font-serif tracking-wide text-lg whitespace-nowrap drop-shadow-md text-center w-full">Penny Health</div></div>
<div id="user-nodes" class="absolute inset-0 z-20"></div>
<!-- Popover Card -->
<div id="user-card" class="absolute top-1/2 left-full ml-6 -mt-32 z-50 animate-fadeIn">
<div class="bg-white rounded-lg shadow-xl p-6 w-80 text-gray-800">
<div class="flex justify-between items-start mb-4">
<h3 id="user-name" class="font-serif text-xl font-bold text-gray-900">Elena Petrova</h3>
</div>
<div class="grid grid-cols-[100px_1fr] gap-y-2 text-sm mb-6">
<div class="text-gray-500">Status</div>
<div class="font-medium flex items-center gap-2">
<span id="user-status-dot" class="w-2 h-2 rounded-full bg-green-500"></span>
                <span id="user-status">Paying Member</span>
            </div>
<div class="text-gray-500">Plan</div>
<div id="user-plan" class="font-medium">Premium</div>
<div class="text-gray-500">Joined</div>
<div id="user-joined" class="font-medium">Oct 21, 2022</div>
<div class="text-gray-500">Last Activity</div>
<div id="user-last" class="font-medium">2 hours ago</div>
<div class="text-gray-500">Location</div>
<div id="user-location" class="font-medium">New York, NY</div>
<div class="text-gray-500">Connections</div>
<div id="user-connections" class="font-medium">156</div>
</div>
<div class="flex gap-3">
<button class="flex-1 px-4 py-2 border border-gray-300 rounded text-sm font-medium hover:bg-gray-50 transition-colors">View Profile</button>
<button class="flex-1 px-4 py-2 border border-gray-300 rounded text-sm font-medium hover:bg-gray-50 transition-colors">Message</button>
</div>
</div>
</div>
</div>
</div>
<!-- END: Network Visualization Area -->
</main>
<!-- END: Main Content -->

<script>
(() => {
  const nodesContainer = document.getElementById('user-nodes');
  const linesGroup = document.getElementById('user-lines');
  const card = document.getElementById('user-card');
  const nameEl = document.getElementById('user-name');
  const statusEl = document.getElementById('user-status');
  const statusDot = document.getElementById('user-status-dot');
  const planEl = document.getElementById('user-plan');
  const joinedEl = document.getElementById('user-joined');
  const lastEl = document.getElementById('user-last');
  const locationEl = document.getElementById('user-location');
  const connectionsEl = document.getElementById('user-connections');

  const searchInputs = Array.from(document.querySelectorAll('[data-role="search"]'));
  const statusInputs = Array.from(document.querySelectorAll('[data-role="status"]'));
  const dateSelect = document.querySelector('[data-role="date-range"]');

  let users = [];
  let filtered = [];
  let selectedId = null;
  let searchTerm = '';
  let statusFilter = 'all';
  let dateRange = dateSelect ? dateSelect.value : 'all';

  const maxNodes = 24;

  const clamp = (value, min, max) => Math.min(Math.max(value, min), max);

  const planLabel = (plan) => {
    if (plan === 'premium') return 'Premium';
    if (plan === 'pro') return 'Pro';
    return 'Free';
  };

  const formatDate = (value) => {
    if (!value) return 'â';
    const date = new Date(value);
    if (Number.isNaN(date.getTime())) return 'â';
    return date.toLocaleDateString();
  };

  const isPaying = (user) => user.plan && user.plan !== 'starter';

  const applyFilters = () => {
    const term = searchTerm.trim().toLowerCase();
    filtered = users.filter((user) => {
      const text = `${user.name || ''} ${user.email || ''}`.toLowerCase();
      if (term && !text.includes(term)) return false;
      if (statusFilter === 'paying' && !isPaying(user)) return false;
      if (statusFilter === 'free' && isPaying(user)) return false;
      if (dateRange && dateRange !== 'all') {
        const days = Number(dateRange);
        if (days) {
          const created = user.created_at ? new Date(user.created_at) : null;
          if (created && !Number.isNaN(created.getTime())) {
            const cutoff = new Date();
            cutoff.setDate(cutoff.getDate() - days);
            if (created < cutoff) return false;
          }
        }
      }
      return true;
    });

    if (!selectedId && filtered.length) {
      selectedId = filtered[0].id;
    }

    if (selectedId && !filtered.some((user) => user.id === selectedId)) {
      selectedId = filtered[0] ? filtered[0].id : null;
    }

    render();
  };

  const updateCard = (user) => {
    if (!card) return;
    if (!user) {
      card.style.display = 'none';
      return;
    }
    card.style.display = 'block';
    nameEl.textContent = user.name || 'Unnamed User';
    statusEl.textContent = isPaying(user) ? 'Paying Member' : 'Free Member';
    statusDot.classList.remove('bg-green-500', 'bg-penny-beige');
    statusDot.classList.add(isPaying(user) ? 'bg-green-500' : 'bg-penny-beige');
    planEl.textContent = planLabel(user.plan);
    joinedEl.textContent = formatDate(user.created_at);
    lastEl.textContent = formatDate(user.last_login);
    locationEl.textContent = 'â';
    connectionsEl.textContent = 'â';
  };

  const render = () => {
    if (!nodesContainer || !linesGroup) return;

    nodesContainer.innerHTML = '';
    linesGroup.innerHTML = '';

    const list = filtered.slice(0, maxNodes);
    const count = list.length || 1;

    list.forEach((user, index) => {
      const seed = (Number(user.id) * 9301 + 49297) % 233280;
      const variance = 10 + (seed % 12);
      const angle = (Math.PI * 2 * index) / count;
      const radius = 32 + variance;
      const rawX = 50 + Math.cos(angle) * radius;
      const rawY = 50 + Math.sin(angle) * radius;
      const x = clamp(rawX, 12, 88);
      const y = clamp(rawY, 12, 88);

      const sizeOptions = [
        { className: 'w-5 h-5 text-[9px]' },
        { className: 'w-6 h-6 text-[10px]' },
        { className: 'w-8 h-8 text-[10px]' },
        { className: 'w-10 h-10 text-[11px]' },
      ];
      const sizeClass = sizeOptions[seed % sizeOptions.length].className;

      const node = document.createElement('div');
      node.className = `absolute ${sizeClass} rounded-full border border-white/20 shadow-lg flex items-center justify-center font-bold text-penny-dark/70 node ${isPaying(user) ? 'bg-penny-green' : 'bg-penny-beige'}`;
      node.style.left = `${x}%`;
      node.style.top = `${y}%`;
      node.style.transform = 'translate(-50%, -50%)';
      node.textContent = `${(user.name || 'U')[0] || 'U'}${(user.name || 'N')[1] || ''}`.toUpperCase();
      node.addEventListener('click', () => {
        selectedId = user.id;
        updateCard(user);
        render();
      });
      nodesContainer.appendChild(node);

      const line = document.createElementNS('http://www.w3.org/2000/svg', 'line');
      line.setAttribute('x1', '50%');
      line.setAttribute('y1', '50%');
      line.setAttribute('x2', `${x}%`);
      line.setAttribute('y2', `${y}%`);
      line.setAttribute('stroke-width', '1');

      if (user.id === selectedId) {
        line.setAttribute('stroke', 'url(#active-line-gradient)');
        line.classList.add('active-connection');
        line.dataset.active = '1';
      } else {
        line.setAttribute('stroke', 'rgba(227, 216, 198, 0.1)');
        line.classList.add('connection-line');
      }
      linesGroup.appendChild(line);
    });

    const activeLine = linesGroup.querySelector('line[data-active="1"]');
    if (activeLine) {
      linesGroup.appendChild(activeLine);
    }


    const selected = list.find((user) => user.id === selectedId) || list[0];
    updateCard(selected);
  };

  const syncSearchInputs = (value, source) => {
    searchInputs.forEach((input) => {
      if (input !== source) {
        input.value = value;
      }
    });
  };

  searchInputs.forEach((input) => {
    input.addEventListener('input', (event) => {
      searchTerm = event.target.value || '';
      syncSearchInputs(searchTerm, event.target);
      applyFilters();
    });
  });

  statusInputs.forEach((input) => {
    input.addEventListener('change', () => {
      const selected = document.querySelector('[data-role="status"]:checked');
      statusFilter = selected ? selected.value : 'all';
      applyFilters();
    });
  });

  if (dateSelect) {
    dateSelect.addEventListener('change', (event) => {
      dateRange = event.target.value || 'all';
      applyFilters();
    });
  }

  const loadUsers = async () => {
    try {
      const response = await fetch('/admin/analytics/users?per_page=200', {
        headers: { 'Accept': 'application/json' },
        credentials: 'same-origin',
      });
      if (!response.ok) throw new Error('Failed to load users');
      const data = await response.json();
      users = data.data || [];
      applyFilters();
    } catch (error) {
      users = [];
      applyFilters();
    }
  };

  loadUsers();
})();
</script>

